import React from 'react'
import { Container } from 'react-bootstrap'

const Homescreen = () => {
    return (
        <div className="home-screen">
            <Container>
                <h1>LATEST PRODUCTS</h1>
            </Container>
        </div>
    )
}

export default Homescreen;
